<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="travailler-avec-kotlin">### Travailler avec Kotlin</a>
</h1>
<div class="Section6"><br><b>Kotlin </b>est un langage de programmation orientée objet prenant en charge le développement d'applications mobiles pour Android.
<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-projet-kotlin">Créer un projet</a>
</h1>
<div class="Section6"><br><b>Android Studio</b> est un environnement de développement intégré prenant en charge le développement d'applications mobiles pour Android.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer un projet No Activity)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu nouveau projet
File &gt; New &gt; Project
# Sélectionner le type d'activité
Phone and Tablet &gt; No Activity
Next
# Définir les informations du projet
Name &gt; rdv_android
Package name &gt; com.ready.app
Save location &gt; v01
Language &gt; Kotlin
Minimum SDK &gt; API 24 ("Nougat"; Android 7.0)
Build configuration language &gt; Kotlin DSL (build.gradle.kts)[Recommended]
Finish
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer l'activité principale)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
res/layout/activity_main.xml
java/com/ready/app/MainActivity.kt
...</pre><br><span class="GText2" style="
color: #00ff00;
">// MainActivity.kt (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="kotlin" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
class MainActivity : AppCompatActivity() {
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_main)
    }
}
