</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="travailler-sur-les-configurations">### Travailler sur les configurations</a>
</h1>
<div class="Section6"><br>Plusieurs <b>configurations </b>sont le plus souvent nécessaires pour mener à bien le développement d'un projet Android.<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-une-activite--empty-views-activity-config">Créer une activité (Empty Views Activity)</a>
</h1>
<div class="Section6"><br>Une activité est gérée par un fichier source (écrit en Kotlin ou en Java) et une vue layout (écrit en XML). Le fichier source permet de gérer la dynamique de l'activité alors que la vue layout est destinée à réaliser la mise en page des composants graphiques de l'interface utilisateur de l'activité au sein du projet Android. Une activité (<b>Empty Views Activity</b>) contient une vue vide dès le départ.&nbsp;<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer une activité)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Nouvelle Activité Android
app &gt; [nom-langage] &gt; [nom-package] &gt; Clic droit &gt; New &gt; Activity &gt; Empty Views Activity
# Définir les informations sur l'activité
Activity Name &gt; MainActivity
Cocher &gt; Generate a Layout File
Layout Name &gt; activity_main
Cocher &gt; Launcher Activity
Package name &gt; [nom-package]
Source Language &gt; [nom-langage]
Finish 
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-une-activite--navigation-drawer-views-activity-config">Créer une activité (Navigation Drawer Views Activity)</a>
</h1>
<div class="Section6"><br>Une activité est gérée par un fichier source (écrit en Kotlin ou en Java) et une vue layout (écrit en XML). Le fichier source permet de gérer la dynamique de l'activité alors que la vue layout est destinée à réaliser la mise en page des composants graphiques de l'interface utilisateur de l'activité au sein du projet Android. Une activité (<b>Navigation Drawer Views Activity</b>) contient une vue initialisée dès le départ pour gérer un DrawerLayout afin de facilité la navigation entre les différents contenus du projet Android.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer une activité Navigation Drawer Views Activity)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Nouvelle Activité Android
app &gt; [nom-langage] &gt; [nom-package] &gt; Clic droit &gt; New &gt; Activity &gt; Navigation Drawer Views Activity
# Définir les informations sur l'activité
Activity Name &gt; MainActivity
Cocher &gt; Generate a Layout File
Layout Name &gt; activity_main
Cocher &gt; Launcher Activity
Package name &gt; [nom-package]
Source Language &gt; [nom-langage]
Finish 
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-avd-config">Créer un AVD</a>
</h1>
<div class="Section6"><br>Un <b>AVD </b>est un Appareil Virtuel Android (Android Virtual Device). Il permet d'émuler un appareil Android sur un ordinateur.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer un AVD)&nbsp;</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Device Manager
Menu &gt; Tools &gt; Device Manager
# Ouvrir le Virtual Device Configuration
Add a new device &gt; Create Virtual Device
# Définir les informations sur l'appareil
Category &gt; Phone
Name &gt; Pixel 9 Pro XL
Next
# Définir les informations sur l'image
Release Name &gt; R
API &gt; 30
ABI &gt; x86
xABI &gt; armeabi-v7a
Target &gt; Android 11.0 (Google Play)
Next
# Définir les informations sur le nom
AVD Name &gt; Pixel 9 Pro XL API 30
Startup orientation &gt; Portrait
Finish
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Windows (Ouvrir le répertoire des AVD)</span><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
C:\Users\tiaka\.android\avd\Pixel_7_Pro_API_30.avd
C:\Users\tiaka\.android\avd\Pixel_9_API_30.avd
C:\Users\tiaka\.android\avd\Pixel_9_Pro_XL_API_30.avd
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-vector-asset-config">Créer un Vector Asset</a>
</h1>
<div class="Section6"><br><b>Vector Asset </b>est un gestionnaire d'icônes. Il permet d'importer des icônes matérielles, des fichiers Scalable Vector Graphics (SVG) et des documents Adobe Photoshop Document (PSD) dans un projet Android en tant que ressources drawable vectorielles.<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer un Vector Asset)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Configure Vector Asset
app &gt; res &gt; drawable &gt; Clic droit &gt; New &gt; Vector Asset
# Définir les informations sur le Vector Asset
Clip art &gt; Rechercher &gt; arrow back &gt; OK
Color &gt; #FFFFFF
Next
Source set &gt; main src/main/res
Output directories &gt; res/drawable/baseline_arrow_back_24.xml
Finish
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creer-un-fragment-config">Créer un Fragment</a>
</h1>
<div class="Section6"><br>Un <b>fragment </b>est gestionnaire de vues au sein d'une activité. Il permet de disposer de plusieurs vues au sein d'une même activité.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer un fragment)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu New Android Component
app &gt; java &gt; [nom-package] &gt; Clic droit &gt; New &gt; Fragment &gt; Fragment (Blank)
# Définir les informations sur le fragment
Fragment Name &gt; [nom-fragment]
Fragment Layout Name &gt; [nom-layout-fragment]
Source Language &gt; [nom-langage]
Finish
...
# Cela crée les fichiers source et layout
...
app/java/com/ready/app/[nom-fragment]
app/res/layout/[nom-layout-fragment]
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="mettre-a-jour-android-sdk-config">Mettre à jour Android SDK</a>
</h1>
<div class="Section6"><br><b>Android SDK</b> est le Kit Développement Logiciel (Software Developement Kit) pour Android. Il fournit l'ensemble des fonctionnalités nécessaires au développement d'un projet Android. La mise à jour de Android SDK est nécessaire pour éviter des problèmes de fonctionnement pendant l'exécution d'un projet Android.<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Mettre à jour Android SDK)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir l'assistant de mises à jour
Menu &gt; Tools &gt; Android SDK Upgrade Assistant
# Continuer les mises à jour
Suivre les instruction &gt; Mettre à jour &gt; Android SDK
...</pre><br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="mettre-a-jour-agp-config">Mettre à jour AGP</a>
</h1>
<div class="Section6"><br><b>AGP </b>est un Plugin Gradle pour Android (Android Plugin Gradle). Il fournit l'ensemble des fonctionnalités nécessaires à la compilation d'un projet Android. La mise à jour de AGP est nécessaire pour éviter des problèmes de fonctionnement pendant l'exécution d'un projet Android.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Mettre à jour AGP)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir l'assistant de mises à jour
Menu &gt; Tools &gt; AGP Upgrade Assistant
# Continuer les mises à jour
Suivre les instruction &gt; Mettre à jour &gt; AGP
...</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
