# Ouvrir le code du Layout
app &gt; res &gt; layout &gt; [nom-layout-xml] &gt; Double Clic
# Ouvrir la vue Code
[nom-layout-xml] &gt; [panneau-des-vues] &gt; [Code]
# Ouvrir la vue Conception
[nom-layout-xml] &gt; [panneau-des-vues] &gt; [Design]
# Ouvrir les 2 vues
[nom-layout-xml] &gt; [panneau-des-vues] &gt; [Split]
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
