</h1>
<div class="Section6"><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Reformater le code XML d'un layout)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
