">// Android Studio (Renommer le fichier layout du fragment)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Renommer le fragment
app &gt; res &gt; layout &gt; [nom-fragment] &gt; Clic droit &gt; Refactor &gt; Rename
# Sélectionner les options
Cocher &gt; Search in comments and strings
# Définir la portée
Scope &gt; Project Files
Refactor
