color: #00ff00;
">// Android Studio (Configurer une image)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Copier une image sur l'ordinateur
Windows &gt; [dossier-image] &gt; [nom-image] &gt; Touche (Ctrl + C)
# Coller l'image dans le dossier drawable
Android Studio &gt; app &gt; res &gt; drawable &gt; Touche (Ctrl + V)
New name &gt; [nom-image]
To directory &gt; [dossier-drawable]
OK
