">// Android Studio (Importer une classe)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Importer la classe
[contenu-code-source] &gt; [classe-en-erreur] &gt; [souris-au-dessus] &gt; Import class 
