<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="synchroniser-un-projet-avec-les-fichiers-gradle-config">Synchroniser un projet avec les fichiers Gradle</a>
</h1>
<div class="Section6"><br><b>Gradle </b>est le compilateur des fichiers sources Android. Il fournit l'ensemble des fonctionnalités nécessaires à la compilation d'un projet Android. La synchronisation d'un projet avec les fichiers Gradle est nécessaire après la modification du fichier de configuration Gradle afin d'éviter des problèmes rencontrés au moment de la compilation du projet Android.<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Synchroniser le projet avec les fichiers Gradle)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Synchroniser le projet avec les fichiers Gradle
Menu &gt; File &gt; Sync Project with Gradle Files
# Vérifier que la synchronisation a réussi
[outil] &gt; Build &gt; Sync &gt; [icone-finish-en-vert]
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="ouvrir-la-fenetre-logcat-config">Ouvrir la fenêtre Logcat</a>
</h1>
<div class="Section6"><br><b>Logcat </b>est une fenêtre d'impression des logs système (produits par le système au moment du lancement et de l'exécution de l'application) et des logs utilisateur (imprimés par l'utilisateur au moment du développement de l'application).  Logcat permet d'identifier rapidement des problèmes de fonctionnement au moment de l'exécution de l'application.<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Ouvrir la fenêtre Logcat)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir la fenêtre Logcat
Menu &gt; View &gt; Tool Windows &gt; Logcat
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Les messages de type (W) sont des messages de Warning (Tout va bien, Attention).&nbsp;<br>Les messages de type (D) sont des message de débogage (Tout va bien).&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Les messages de type (E) sont des message d'erreur (Tout va mal, Problème).&nbsp;<br>Dans la capture ci-dessous, nous observons un problème au niveau de la méthode (Toast.makeText).&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="deboguer-un-projet-android-config">Déboguer un projet Android</a>
</h1>
<div class="Section6"><br>L'exécution du projet en mode débogage (<b>DEBUG</b>) permet de suivre l'exécution d'un projet Android pas à pas afin de diagnostiquer et de déceler les causes d'éventuels problèmes de fonctionnement dans le but d'apporter une correction beaucoup plus adaptée.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Exécuter un projet en mode débogage)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Placer un point d'arrêt
Cliquer sur le bord gauche d'une ligne de code &gt; Pour placer un point d'arrêt
# Exécuter le projet en mode débogage
Menu &gt; Run &gt; Debug 'app'
# Utiliser les outils de navigation en mode débogage
Pour exécuter le projet pas à pas
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="corriger-le-probleme-de-caches-invalides-config">Corriger le problème de caches invalides</a>
</h1>
<div class="Section6"><br>Dans certaines situations, l'incohérence des données contenues dans le répertoire des <b>caches </b>de Gradle peut entrainer des problèmes de synchronisation du projet avec les fichiers Gradle.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Corriger le problème de synchronisation avec Gradle)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu Invalidate Caches
Menu &gt; File &gt; Invalidate Caches
# Définir les opérations à réaliser
Cocher &gt; Clear file system cache and Local History
Cocher &gt; Clear VCS Log caches and indexes
Cocher &gt; Delete embedded browser engine cache and cookies
Invalidate and Restart
...</pre><br><span class="GText2" style="
color: #00ff00;
">// Windows (Corriger le problème de synchronisation avec Gradle)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Redémarrer l'ordinateur
Bouton Windows &gt; Redémarrer
...
# Renommer le répertoire (.gradle)
C:\Users\[username]\.gradle &gt; C:\Users\[username]\.gradle-02
...
# Redémarrer Android Studio
Bouton Windows &gt; Android Studio
...
# Android Studio
# Synchroniser le projet avec les fichiers Gradle
...</pre><br></div>
</div>
</div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="corriger-le-probleme-de-systeme-ui-ne-repond-pas-config">Corriger le problème de système UI ne répond pas</a>
</h1>
<div class="Section6"><br>Dans certaines situations, la grande quantité des données sauvegardées dans la mémoire de l'émulateur peut entrainer des problèmes de fonctionnement au niveau de l'interface utilisateur de l'application.
<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Corriger le problème système UI ne répond pas)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Arrêter l'application
Menu &gt; Tools &gt; Device Manager &gt; [Running Device] &gt; Close app
# Arrêter l'emulateur
Menu &gt; Tools &gt; Device Manager &gt; [Device Manager] &gt; [emulateur-android] &gt; Stop
# Arrêter l'emulateur
Menu &gt; Tools &gt; Device Manager &gt; [Device Manager] &gt; [emulateur-android] &gt; [parametres] &gt; Wipe Data
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
